import React from "react";

function Menu(props) {
  return (
    <section id="Menu">
      <div className="container">
        <h5 className="comp-title">Specials Menu</h5>
        <h2>Luxurious Chocolate-Draped Elegance</h2>
        <div className="row">
          <div className="col-md-4">Box</div>
          <div className="col-md-4">Box</div>
          <div className="col-md-4">Box</div>
        </div>
        <a href="#">View Full Menu</a>
      </div>
    </section>
  );
}

export default Menu;
